import React from 'react'
import DatePicker from 'react-datepicker'
import 'react-datepicker/dist/react-datepicker.css'
import axios from 'axios'

export default class CreateVehicle extends React.Component {

    state = {
        make: '',
        model: ''
        //year: 
        //numberPlate: 
        // staff: 
        // OwnedOrLeased:
        // cost: 
        // purchasedLeased: 
        // regoDone: 
        // warrantDone: 
        // odometer: 
        // odometerDate: 
    }

    // DO I NEED componentDidMount method here? 

    onChangeMake = (e) => {
        this.setState({
            make: e.target.value
        })
    }

    onChangeModel = (e) => {
        this.setState({
            model: e.target.value
        })
    }

    // NEED TO ADD METHODS FOR ALL FIELDS

    onSubmit = (e) => {
        e.preventDefault()
        const vehicle = {
            make: this.state.make,
            model: this.state.model 
        }

        axios.post('http://localhost:5000/vehicles/add')

        window.location = '/'
    }
    // INSTALL DATEPICKER FOR ALL DATE ENTRIES
    render() {
        return(
            <div>
                <h3>Add Vehicle Entry</h3>
                <form onSubmit={this.onSubmit}>
                    <div className='form-group'>
                        <label>Make: </label>
                        <input type='text' 
                        required className='form-control' 
                        value={this.state.make} 
                        onChange={this.onChangeMake}/>
                    </div>
                    <div className='form-group'>
                        <label>Model: </label>
                        <input type='text' 
                        required className='form-control' 
                        value={this.state.model} 
                        onChange={this.onChangeModel}/>
                    </div>
                    <div className='form-group'>
                        <input type='submit' value='Add Vehicle' className='btn btn-primary'/>
                    </div>
                </form>
            </div>
        )
    }
}
